def encrypt_pass(courriel, password):
    salt = str.encode(courriel)
    mot_de_passe = hashlib.pbkdf2_hmac('sha256', password.encode('utf-8'), salt, 10)
    alpha = ""
    for character in str(mot_de_passe):
        if character.isalnum():
            alpha += character
    return alpha

